import React, { useState, useEffect } from "react";
import GolfDataService from "../../../services/golf";
import "./algorithmForm.css";
import Form from "react-bootstrap/Form";
import RangeSlider from "react-bootstrap/FormRange"

function AlgorithmForm() {

  const [ value, setValue ] = React.useState(50);


  return (
    <div className="algorithmFormComponentContainer">


      <div className="algorithmForm">

        {/* <div className="selectionOne">
          <Form.Label>Putting</Form.Label>
          <Form.Range />
        </div>
        <div className="selectionTwo">
          <Form.Label>Fairways</Form.Label>
          <Form.Range />
        </div>
        <div className="selectionThree">
          <Form.Label>GIR</Form.Label>
          <Form.Range />
        </div>
        <div className="selectionFour">
          <Form.Label>Birdies</Form.Label>
          <Form.Range />
        </div> */}

<Form>
      <Form.Group>
        <Form.Label>
          Birdies
        </Form.Label>
        <RangeSlider
          value={value}
          onChange={e => setValue(e.target.value)}
        />
      </Form.Group>
    </Form>
      </div>
      
    </div>
  );
}

export default AlgorithmForm;
